import React from 'react';
import "./AddedCartMessage.css"

export default function AddedCartMessage(props) {
    return (
        <div className="AddedCartMessage">
            <div className="image"><img style={{width: "40px"}} src={props.image} alt={props.name}></img></div>
            <div className="brand">{props.brand}</div>
    <div className="name">{props.name}</div> 
        </div>
    )
}
